function Starting_Game_Mechanics () {
    Hero = sprites.create(assets.image`myImage0`, SpriteKind.Player)
    scene.cameraFollowSprite(Hero)
    controller.moveSprite(Hero, 100, 0)
    Hero.ay = 200
    canDoubleJump = true
    info.setScore(0)
    info.setLife(3)
}
controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    if (i < 4) {
        i += 1
    } else {
        i = 0
    }
    if (Spectate == 1) {
        scaling.scaleToPercent(Spectator, list[i], ScaleDirection.Uniformly, ScaleAnchor.Middle)
    } else {
        if (ShieldStatus == 1) {
            if (Hero.vy == 0) {
                Hero.vy = -80
            }
            if (Hero.isHittingTile(CollisionDirection.Bottom)) {
                Hero.vy = -80
            } else if (canDoubleJump) {
                Hero.vy = -40
                canDoubleJump = false
            }
        } else {
            if (Hero.vy == 0) {
                Hero.vy = -80
            }
            if (Hero.isHittingTile(CollisionDirection.Bottom)) {
                Hero.vy = -120
            } else if (canDoubleJump) {
                Hero.vy = -100
                canDoubleJump = false
            }
        }
    }
})
